    if(!hasCostumer){

    } 
    return(
        <div>
            <h1>Nome do cliente aqui</h1>
        </div>
    )
}


const App = () => {
    
    
    return (
        <div>
        <p>Digital Inovation One</p>
        <p>Hello World</p>
        
        <br />
        {hasCostumer ?(
            <div>
            Veja o histórico<br/>
            {buttonA}
            </div>
            
            ) :(
                <div>
                Cadastre-se <br/> {buttonB}
                </div>
                )}
                
                </div>
                );
            };
        <div>
            {costumer}
        </div>
            


export default App;
